import './Expenses.css';
import ExpenseItem from './ExpenseItem';

function Expenses(expense){
    return (
        <div className='expenses'>
            <ExpenseItem title={expense.title} amount={expense.amount} date={expense[0].date}/>
        </div>
    )
}

export default Expenses;
